const Total = ({ parts }) => {
    var accumulator = 0
    parts.reduce((accumulator, currentValue) => 
        accumulator + currentValue.id,0,
        console.log(accumulator)
    )
    console.log(accumulator)
    return(
        <p>Total of {accumulator} excercises</p>
    )
}

export default Total
